import React from 'react'

class InventoryItems extends React.Component {
    constructor(props) {
        super(props);
        this._handleClick = this._handleClick.bind(this);
      }

    _handleClick(){
     this.props.addToCart(this.props.name,this.props.quantity)
    }

    render() {
        return (
            <div className="row ingredientCartItem">
            <div className="col">
                <p className="FoodNameLabelBlack">Ingredient Name</p>
            </div>
            <div className="col-4">
                <div className="row">
                    <div className="col d-inline-flex IngredientCartItemAmountSelectCol"><i className="la la-minus float-left hoverItem"></i>
                        <p className="text-center FoodNameLabelBlack">25</p><i className="la la-plus float-right hoverItem"></i></div>
                </div>
            </div>
        </div>
    );
    }
}    

export default InventoryItems
